The State files and Amended Information which  adds a count of PTC criminal trespass to dwelling, contrary to Section 943.14 and 939.05 of the Wisconsin Statutes.  
NO CONTEST pleas entered to counts 2 and 3 of the Amended Information, charges of PTC criminal trespass to dwelling and PTC theft. Convicted.
The State moves to dismiss and read in count 1, PTC burglary.  Motion granted.
Sentence Withheld.  Defendant is placed on probation to DOC for two (2) years.
Conditions of probation:
1) Assessment, treatment, counseling as deemed appropriate by the Departments assessment process;
2) No contact with Marcella Becker or Buck Herrera;
3) Maintain absolute sobriety;
4) Pay court costs;
5) pay supervision fees in an amount to be determined by DOC;
6) AODA assessment and follow through;
7) Spend ninety (90) days in the county jail, under the Huber Law, on count 2 only, stayed, and to be imposed at the agents discretion and upon order of the court.
